pragma solidity ^0.4.18;

import './TonerCoin.sol';
import 'zeppelin-solidity/contracts/math/SafeMath.sol';
import 'zeppelin-solidity/contracts/crowdsale/validation/CappedCrowdsale.sol';
import 'zeppelin-solidity/contracts/crowdsale/distribution/RefundableCrowdsale.sol';
//import 'zeppelin-solidity/contracts/crowdsale/validation/WhitelistedCrowdsale.sol';

interface token {
  function transfer(address _to, uint value);
}

//contract TonerCoinCrowdsale is CappedCrowdsale, RefundableCrowdsale {
contract TonerCoinCrowdsale is Crowdsale, Ownable {

  using SafeMath for uint256;

  uint256 public rate;
  address public wallet;
  TonerCoin public token;

  event RateUpdate(uint256 rate);

  // contract constructor
  function TonerCoinCrowdsale(
    uint256 _preico_openingTime,
    uint256 _preico_closingTime,
    uint256 _ico_openingTime,
    uint256 _rate,
    address _wallet,
    uint256 _preico_cap,
    uint256 _ico_cap,
    TonerCoin _token) public Crowdsale(_rate, _wallet, _token) {
      require(_token != address(0));
      rate = _rate;
      wallet = _wallet;
      token = _token;
  }

  function setRate(uint256 _rate) private onlyOwner {
    rate = _rate;
    RateUpdate(rate);
  }

  // fallback function can be used to buy tokens
  function () external payable {
      buyTokens(msg.sender);
  }

  // low level token purchase function
  function buyTokens(address _beneficiary) public payable {

    uint256 weiAmount = msg.value;
    _preValidatePurchase(_beneficiary, weiAmount);

    uint256 tokens = calculateTokenAmount(weiAmount);
    //uint256 tokens = _getTokenAmount(weiAmount);

    weiRaised = weiRaised.add(weiAmount);

    _processPurchase(_beneficiary, tokens);
    TokenPurchase(msg.sender, _beneficiary, weiAmount, tokens);

    _updatePurchasingState(_beneficiary, weiAmount);

    _forwardFunds();
    _postValidatePurchase(_beneficiary, weiAmount);

  }

  function calculateUSD(uint256 _weiAmount) public view returns (uint256) {
    // wei per USD cent
    uint256 weiPerUSDc = 1 ether/rate;
    // Deposited value converted to USD cents
    uint256 weiAmountInUSDc = _weiAmount.div(weiPerUSDc);
    return weiAmountInUSDc;
  }

  function calculateTokenAmount(uint256 _weiAmount) public view returns (uint256) {
    uint256 tokens = calculateUSD(_weiAmount);
    return tokens;
  }

}
